        public string[] GetMetroName(string[] inList)
        {
            Excel.Application app=new Excel.Application();
            Excel.Workbook wb = app.Workbooks.Open(@TestProject1.Settings1.Default.filePath);
            Excel.Worksheet wsh = wb.Worksheets[TestProject1.Settings1.Default.sheetName];
            string str="";

            // ищем станции по файлу
            string errStreets = "";
            foreach(string s in inList)
            {
                string ul= s.Substring(8);

                #region Перестановка сокращений в названии улици в начало 
                
                // "просп." ставим в начало
                if(ul.Contains("просп."))
                {
                    int start=ul.IndexOf("просп.");
                    if (start > 0)
                    {
                        ul = ul.Remove(start-1, 7);
                        ul = "просп. " + ul;
                    }
                }

                // "бул." ставим в начало
                if (ul.Contains("бул."))
                {
                    int start = ul.IndexOf("бул.");
                    if (start > 0)
                    {
                        ul = ul.Remove(start - 1, 5);
                        ul = "бул. " + ul;
                    }
                }

                // "ш." ставим в начало
                if (ul.Contains("ш."))
                {
                    int start = ul.IndexOf("ш.");
                    if (start > 0)
                    {
                        ul = ul.Remove(start - 1, 3);
                        ul = "ш. " + ul;
                    }
                }

                // "пр-д" ставим в начало
                if (ul.Contains("пр-д"))
                {
                    int start = ul.IndexOf("пр-д");
                    if (start > 0)
                    {
                        ul = ul.Remove(start - 1, 5);
                        ul = "пр-д " + ul;
                    }
                }

                // "пер." ставим в начало
                if (ul.Contains("пер."))
                {
                    int start = ul.IndexOf("пер.");
                    if (start > 0)
                    {
                        ul = ul.Remove(start - 1, 5);
                        ul = "пер. " + ul;
                    }
                }              
                
                #endregion

                // Длина цикла зависит от количества строк в файле "Адреса.xlsx"
                for (int i = 1; i<120 ;i++ )
                {
                    Excel.Range r1 = wsh.Cells[i, 1];
                    Excel.Range r2= wsh.Cells[i, 2];
                    string val1 = r1.get_Value();
                    string val2 = r2.get_Value();
                    if (ul.Contains(val1))
                    {
                        str += val2 + ";";
                        break;
                    }
                    if (i == 119)
                        errStreets += ul+";";                        
                }                   
            }

            // ищем станции метро по отсутствующим адресам  
            if (errStreets.Length > 0)
            {
                string[] errMetro= GrabMetro(errStreets.Substring(0, errStreets.Length - 1).Split(';'));
                foreach (string em in errMetro)
                {
                    str += (em+";");
                }
            }
            
            app.Workbooks.Close();
            return str.Remove(str.Length - 1).Split(';');
        }

